import binascii
import os
import errno
from pyrevit import output, script


logobase64 = ""

BinStr = binascii.a2b_base64(logobase64)


cwd = dir_path = os.path.dirname(os.path.realpath(__file__))
filename = "C:\\temp\\btc.png"
if not os.path.exists(os.path.dirname(filename)):
    try:
        os.makedirs(os.path.dirname(filename))
    except OSError as exc: # Guard against race condition
        if exc.errno != errno.EEXIST:
            raise

logo = open(filename,"wb")
logo.write(BinStr)
logo.close()


output = script.get_output()
output.print_image(r'C:\\temp\\btc.png')
output.print_html("<h2>168pggAtGmnqmVecuiB4jr9v11Zn1ShvJU</h2>")

